import React, { useEffect, useState } from 'react'

function Iphone11() {

    const [iphone,setIphone] = useState()

       const getIphone = async ()=>{
        const url = "http://localhost:5000/iphone/iphone11"

        const response = await fetch(url);
        const responseJson = await response.json();

        setIphone(responseJson.iphone)
    }

        useEffect(()=>{
          getIphone()
        },[])

  return (
    <div>
        {iphone && iphone.map((i)=>
            <div key={i._id}>

                 <h4>{iphone.name}</h4>

                 <img src={i.img} alt={i.name} width={200}/>

            </div>



        )}

    </div>
  )
}

export default Iphone11
